import React, { useEffect, useState } from "react";
import fetchQuotes from "./api/api"; // Update the path to match the actual location
import { prettyDOM } from "@testing-library/react";

const App = () => {
  const [pokemonData, setPokemonData] = useState([]);
  const [loading, setLoading] = useState(true);

  let test = 32;
  useEffect(() => {
    const fetchData = async () => {
      try {
        const pokemonData = await fetchQuotes();
        setPokemonData(pokemonData);
        setLoading(false);
        console.log(pokemonData);
        // console.log(typeof quotesData);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  // console.log(typeof pokemonData.moves, "asdfasfas");

  console.log(Object.values(pokemonData.moves[0]), "asdfffffff");

  return (
    <div>
      <h1>Pokemon Abilities</h1>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <div className="border">
            <h2 className="text-xl font-bold">Abilities:</h2>
            <ul>
              {pokemonData.abilities.map((abilityObj, index) => (
                <li key={index}>{abilityObj.ability.name}</li>
              ))}
            </ul>
          </div>
          <div>
            <h2>Abilities:</h2>
            <ul>
              {pokemonData.moves.map((movesObj, index) => (
                <li key={index}>{movesObj[0]}</li>
              ))}
            </ul>
          </div>
          <pre>{JSON.stringify(pokemonData.moves, null, 2)}</pre>
        </div>
      )}
    </div>
  );
